const Navbar = () => {
    return(   
      <>
        <div className="flex bg-mybgcolor w-full h-full">
          <div className="flex bg-mycolor w-3.5 h-14">
            <h1>
            Halo
            </h1>
          </div>
        </div>
      </>
    );
}



export default Navbar;
